  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Ouray
  National Wildlife Refuge outlines Refuge accomplishments during the 1964 calendar
  year.  The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, mammals, and raptors- is also covered.
  The Refuge development and maintenance section discusses physical developments,
  plantings, collections and receipts, vegetation control, and prescribed burning.
  Resource management is outlined; topics include grazing, haying, and timber removal.
  A progress report on field investigations and applied research is also provided.
  The public relations section of the report describes recreational uses, Refuge visitors,
  Refuge participation, hunting, violations, and safety. Items of interest and N-R
  forms are attached\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
